  line11 = new com_google_gwt_user_client_ui_Label_Label__Ljava_lang_String_2V("The instructions in the image above were added to the editor and then assembled, ready to be executed. The CPU Log shows the 5 pipeline stages separated by a '|'. So the stages are as follows: Instruction Fetch (IF), Instruction Decode (ID), Execute (EX), Memory Access (MEM), and Write Back (WB). The first instruction 'MOVZ' (Explained in the Data Transfer Instructions) is processed in the IF stage. After this, the second instruction will be processed in the IF stage while the first instruction will move to the ID stage.. and so on.");
