  line13 = new com_google_gwt_user_client_ui_Label_Label__Ljava_lang_String_2V("A data hazard occurs due to the data dependencies between the two 'MOVZ' instructions and the 'SUB' instruction. The processor can either stall the pipeline and wait until the data is available or use logic to detect dependencies and then select where to read the operand from. This simulator has been programmed to do the latter.");
  line14 = new com_google_gwt_user_client_ui_Label_Label__Ljava_lang_String_2V("Note that 'A' refers to the first operand i.e, the first register you choose to do the operation with; in this case, 'A' is x1. Likewise, 'B' refers to the second operand; in this case x2.");
  com_google_gwt_user_client_ui_UIObject_setStyleName__Lcom_google_gwt_dom_client_Element_2Ljava_lang_String_2ZV(line14.com_google_gwt_user_client_ui_UIObject_element, 'note1', true);
  line15 = new com_google_gwt_user_client_ui_Label_Label__Ljava_lang_String_2V("'Data Hazard: EX, forward B' means that the processor forwards the value for x2 from the second MOVZ instruction ( currently in the EX stage) to be used in the subtract instruction. 'Data Hazard: MEM, forward A' means that the processor forwards the value for x1 from the first MOVZ instruction (currently in the MEM stage) to be used in the subtract instruction.");
