  line16 = new com_google_gwt_user_client_ui_Label_Label__Ljava_lang_String_2V("Another thing to note is the method to store a value to memory. The two required instructions are MOVZ and LSL. Have a look at instruction 5 and 6. This effectively stores the value '0x10000000' which is the Dynamic memory offset into register x27. After this, the store instruction on line 7 accesses memory by going to the memory location specified by the addition of x27 and the immediate value 5. This would effectively be the fifth location of (accessible) memory.");
