  line17 = new com_google_gwt_user_client_ui_Label_Label__Ljava_lang_String_2V('Again, there is a data hazard as the Add instruction requires x0 (this value is forwarded from the SUB instruction in the EX stage) and x2 (this value is forwarded from the MOVZ instruction in the MEM stage).');
