  space14 = new com_google_gwt_user_client_ui_Image_Image__Ljava_lang_String_2V($intern_61);
  line18 = new com_google_gwt_user_client_ui_Label_Label__Ljava_lang_String_2V("The last thing to note for this walkthrough is the an example of a control hazard and pipeline stall. Below, we have a Conditional Branch instruction which will branch if the value in register x6 is equal to zero. The CPU Log shows a line which says 'Control Hazard: Flushing Pipeline'. Note that this does not happen until the instruction is evaluated to be true. Furthermore, there is a data hazard which requires stalling of the pipeline. This is because the new value of register x6 is still being evaluated by the previous SUB instruction. Thus the pipeline is stalled until this value is ready and then the pipeline is flushed when the conditional branch is evaluated to be true.");
